import api from '../../services/api.js';

export default class DetailClient extends Component {

  state = {
    id: "",
    first_name: "",
    last_name: "",
    email: "",
    phone_number: "",
    cellphone_number: "",
    birthdate: "",
    CPF: "",
    RG: ""
  };

  constructor(props) {
    super(props);
  }

  async componentDidMount() {
    const { id } = this.props.match.params;
    const response = await api.get(`/client/${id}`);
  }

  render() {
    return (
      <div>
        <h2>Detalhe do Cliente</h2>

      </div>
    );
  }
}
